    function mobileOnlySlider() {
        $('.find-cost__type').slick({
            slidesToShow: 1,
            slidesToScroll: 1,
            dots: false,
            arrows: false,
            draggable: true,
            swipe: true,
            autoplay: false,
            accessibility: false,
            adaptiveHeight: true,
            infinite: false,
            lazyLoad: 'progressive',
            centerMode: true,
            variableWidth: true,
            centerPadding: '0px',
            swipeToSlide: false,
            focusOnSelect: true,
        });
        $('.find-cost__type').on('beforeChange', function (event, slick, currentSlide, nextSlide) {
            $('.find-cost__slide[data-slick-index="' + nextSlide + '"] [type="radio"]').prop('checked', true).change();
        });
    }
    if (window.innerWidth < 700) {
        mobileOnlySlider();
    }

    $(window).resize(function (e) {
        if (window.innerWidth < 700) {
            if (!$('.find-cost__type').hasClass('slick-initialized')) {
                mobileOnlySlider();
            }

        } else {
            if ($('.find-cost__type').hasClass('slick-initialized')) {
                $('.find-cost__type').slick('unslick');
            }
        }
    });
	
